import { BrowserRouter } from 'react-router-dom';
import './App.css';
import Header from './Components/HeaderComponent/Header';
import Navbar from './Components/NavbarComponent/Navbar';
function App() {
  return (
   <>
    <div className="App">
      <BrowserRouter>
      <Header />
      </BrowserRouter>
      <Navbar />
    </div>
   </>
  );
}

export default App;
